import { Link } from "react-router-dom";
import ExamSubjectCollaps from "./ExamSubjectCollaps";

const Collaps = ({children}) => {
  return (
    <>
      <div className="col-12 mt-5 py-5">
        <h3 className="fw-bold text-black-50">
          Select Subject To See Exams Results
        </h3>
      </div>
      <div className="col-12">
        <div className="row">
          {/* Main Collaps */}
          <div className="col-12 border border-2 p-2 mt-2">
            <p className="">
              <button
                className="btn btn-outline-primary w-100 text-start mt-3"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#MaincollapseExample1"
                aria-expanded="false"
                aria-controls="MaincollapseExample1"
              >
                Software Engineering
              </button>
            </p>
            <div className="collapse overflow-auto" id="MaincollapseExample1">
                
             {children}
            </div>
          </div>
          {/* Main Collaps */}
        </div>
      </div>
    </>
  );
};

export default Collaps;
